    true,nt"url": null,nt"notes": "A web database is provided which can be
    used to calculate photon cross sections for scattering, photoelectric absorption
    and pair production, as well as total attenuation coefficients, for any element,
    compound or mixture (Z <= 100) at energies from 1 keV to 100 GeV. XCOM provides
    two forms of output: (a) tables which correspond closely in format to existing tables
    in the literature; (b) graphical display of the tabular data.   Access to the database
    is provided through a web-based form located at: http://physics.nist.gov/PhysRefData/Xcom/html/xcom1.html.",nt"license_title":
